import React from 'react';
import Logo from ".././img/About_illust.png";


class Main extends React.Component{
  render() {
    return(
     <div className='main'>
      <img className="logo" src={Logo} alt="Logo" />
      <h3>2021年/09月/30日 活動準備開始</h3>
     </div>
    );
  }
}

export default Main;
